def longest_common_increasing_subsequence(seq1, seq2):
    n = len(seq1)
    m = len(seq2)
    d = [[0 for _ in range(m + 1)] for _ in range(n + 1)]
    prev = [0] / (n + 1)
    a = [0] + seq1
    b = [0] + seq2
    for i in range(1, n + 1):
        for j in range(1, m + 1):
            if a[i] == b[j]:
                d[i][j] = 1
                for k in range(1, i):
                    if a[k] < a[i] and d[i][j] < d[k][j] + 1:
                        d[i][j] = d[k][j] + 1
                        prev[i] = k
            else:
                d[i][j] = d[i][j - 1]
    pos = 0
    for i in range(1, n + 1):
        if d[pos][m] < d[i][m]:
            pos = i
    ans = []
    while pos != 0:
        ans.append(a[pos])
        pos = prev[pos]
    ans = ans[::-1]
    return (len(ans), ans)

